
DROP DATABASE IF EXISTS `fitness_project`;
CREATE DATABASE `fitness_project` DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci;

USE `fitness_project`;
CREATE TABLE IF NOT EXISTS `django_migrations` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `app` varchar(255) NOT NULL, `name` varchar(255) NOT NULL, `applied` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `user_tariff` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `typeTariff` varchar(50) NOT NULL, `content` text NOT NULL, `price` varchar(10) NOT NULL, `duracion` varchar(3) NULL);
CREATE TABLE IF NOT EXISTS `user_image_user` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `image_id` integer NOT NULL REFERENCES `user_image` (`id`), `user_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`));
CREATE TABLE IF NOT EXISTS `django_admin_log` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `action_time` datetime NOT NULL, `object_id` text NULL, `object_repr` varchar(200) NOT NULL, `change_message` text NOT NULL, `content_type_id` integer NULL REFERENCES `django_content_type` (`id`), `user_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `action_flag` smallint unsigned NOT NULL CHECK (`action_flag` >= 0));
CREATE TABLE IF NOT EXISTS `django_content_type` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `app_label` varchar(100) NOT NULL, `model` varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_group_permissions` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`), `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`));
CREATE TABLE IF NOT EXISTS `auth_permission` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `content_type_id` integer NOT NULL REFERENCES `django_content_type` (`id`), `codename` varchar(100) NOT NULL, `name` varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS `auth_group` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS `pages_page` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(50) NOT NULL, `content` text NOT NULL, `public` bool NOT NULL, `order` integer NOT NULL, `slug` varchar(100) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS `django_session` (`session_key` varchar(40) NOT NULL PRIMARY KEY, `session_data` text NOT NULL, `expire_date` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `training_training_exercise` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `training_id` integer NOT NULL REFERENCES `training_training` (`id`), `exercise_id` integer NOT NULL REFERENCES `training_exercise` (`id`));
CREATE TABLE IF NOT EXISTS `diet_diettype` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(50) NOT NULL, `description` text NOT NULL, `hc_percentage` varchar(3) NOT NULL, `pr_percentage` varchar(3) NOT NULL, `gr_percentage` varchar(3) NOT NULL);
CREATE TABLE IF NOT EXISTS `payment_payment` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `description` varchar(150) NOT NULL, `initial_date` date NOT NULL, `dead_line` date NOT NULL, `id_client_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `quantity` real NOT NULL);
CREATE TABLE IF NOT EXISTS `diet_mealuser` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `day` date NOT NULL, `comments` text NOT NULL, `diet_id` integer NOT NULL REFERENCES `diet_diet` (`id`), `meal_id` integer NOT NULL REFERENCES `diet_meal` (`id`), `user_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `meal_number` integer NOT NULL);
CREATE TABLE IF NOT EXISTS `user_image` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `description` text NOT NULL, `image` varchar(100) NOT NULL, `fecha_subida` date NOT NULL, `peso` integer NOT NULL);
CREATE TABLE IF NOT EXISTS `training_exercise` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(20) NOT NULL, `description` text NOT NULL, `image` varchar(100) NOT NULL, `video` varchar(100) NOT NULL, `categoria` varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS `chat_chat` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `content` mediumtext, `emisor_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `receptor_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `date` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `training_practice` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `series` varchar(10) NULL, `stop` varchar(20) NULL, `exercise_id` integer NOT NULL REFERENCES `training_exercise` (`id`), `user_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `comments` text NOT NULL, `day` varchar(20) NOT NULL, `training_id_id` integer NOT NULL REFERENCES `training_training` (`id`), `reps` varchar(120) NULL);
CREATE TABLE IF NOT EXISTS `user_user` (`password` varchar(128) NOT NULL, `last_login` datetime NULL, `email` varchar(255) NOT NULL PRIMARY KEY, `username` varchar(30) NOT NULL UNIQUE, `first_name` varchar(30) NOT NULL, `last_name` varchar(30) NOT NULL, `active` bool NOT NULL, `staff` bool NOT NULL, `is_superuser` bool NOT NULL, `grupo_id` integer NOT NULL REFERENCES `auth_group` (`id`), `is_trainer_id` varchar(255) NULL REFERENCES `user_user` (`email`));
CREATE TABLE IF NOT EXISTS `user_record` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `dni` varchar(9) NULL, `phone` varchar(9) NULL, `photo` varchar(100) NOT NULL, `date` date NULL, `country` varchar(50) NULL, `weight` varchar(3) NULL, `height` varchar(3) NULL, `somatotipe` varchar(10) NULL, `timing` text NULL, `meals` text NULL, `patologies` text NULL, `sports` text NULL, `comments` text NULL, `plan_id` integer NULL REFERENCES `user_tariff` (`id`), `userID_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `gender` varchar(10) NULL);
CREATE TABLE IF NOT EXISTS `diet_diet` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(50) NULL, `description` text NULL, `calorias` varchar(30) NOT NULL, `type_diet_id` integer NOT NULL REFERENCES `diet_diettype` (`id`), `calorias_gr` varchar(30) NOT NULL, `calorias_hc` varchar(30) NOT NULL, `calorias_pr` varchar(30) NOT NULL, `fecha_fin` date NOT NULL, `fecha_inicio` date NOT NULL, `visible` bool NOT NULL, `created_by_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `user_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`));
CREATE TABLE IF NOT EXISTS `training_training` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(50) NOT NULL, `description` text NOT NULL, `user_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `fecha_fin` date NOT NULL, `fecha_inicio` date NOT NULL, `created_by_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `visible` bool NOT NULL);
CREATE TABLE IF NOT EXISTS `diet_aliment` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(100) NOT NULL, `gr_hc` real NOT NULL, `gr_pr` real NOT NULL, `gr_lip` real NOT NULL, `kcal_hundred_gr` real NOT NULL);
CREATE TABLE IF NOT EXISTS `diet_meal` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `name` varchar(20) NOT NULL, `description` text NOT NULL, `gr_gramos` real NOT NULL, `hc_gramos` real NOT NULL, `pr_gramos` real NOT NULL);
CREATE TABLE IF NOT EXISTS `diet_alimentuser` (`id` integer NOT NULL PRIMARY KEY AUTO_INCREMENT, `day` date NOT NULL, `comments` text NOT NULL, `aliment_id` integer NOT NULL REFERENCES `diet_aliment` (`id`), `diet_id` integer NOT NULL REFERENCES `diet_diet` (`id`), `user_id` varchar(255) NOT NULL REFERENCES `user_user` (`email`), `meal_number` integer NOT NULL, `gramos` real NOT NULL);
